uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_twist; 
uniform float u_hue;   // Near Color Start
uniform float u_hue2;  // Color Spread / Shift Amount

out vec4 fragColor;

// --- Helper Functions ---

vec3 hsb2rgb(vec3 c) {
    // We fract(c.x) here to safely wrap the hue 
    // regardless of how large the number gets
    vec3 rgb = clamp(abs(mod(c.x * 6.0 + vec3(0.0, 4.0, 2.0), 6.0) - 3.0) - 1.0, 0.0, 1.0);
    rgb = rgb * rgb * (3.0 - 2.0 * rgb);
    return c.z * mix(vec3(1.0), rgb, c.y);
}

// "Candy" Palette Logic
vec3 getRichPastelColor(float hue, float z) {
    float sat = mix(0.85, 0.4, z); 
    float bri = mix(1.0, 0.6, z); 
    return hsb2rgb(vec3(fract(hue), sat, bri));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 uv0 = uv;

    // Params
    float spd = (u_speed <= 0.0) ? 0.3 : u_speed;
    float time = iTime * spd;
    float twistAmt = (u_twist == 0.0) ? 0.0 : u_twist; 

    // --- PETAL ANIMATION (Smooth Morph) ---
    // 0 to 10 and back
    float rawPetals = 5.0 + 5.0 * sin(iTime * 0.105);

    // Calculate blending neighbors
    float p1 = floor(rawPetals);      
    float p2 = p1 + 1.0;              
    float blend = fract(rawPetals);   

    // --- HUE ANIMATION (The Fix) ---
    // Instead of fract(), we let time accumulate.
    // 'u_hue' sets the starting point.
    // 'u_hue2' sets how much the color changes deeper in the tunnel.
    float baseHue = (u_hue == 0.0) ? 0.5 : u_hue;
    float spread = (u_hue2 == 0.0) ? 0.3 : u_hue2; // Default to small rainbow spread

    // Animate the base hue slowly over time
    float animHue = baseHue + iTime * 0.05; 

    // Background
    vec3 finalColor = vec3(0.02, 0.01, 0.05);

    float angle = atan(uv.y, uv.x);
    float radius = length(uv);

    const int LAYERS = 60; 

    for(int i = LAYERS; i > 0; i--) {

        float zIndex = float(i) - fract(time * 0.8); 
        float z = zIndex * 0.15; 

        if(z < 0.1) continue; 

        float projection = 1.0 / z;

        // --- VORTEX SHAPE ---
        float currentAngle = angle + z * twistAmt + time * 0.5;

        // Morph Blend Waves
        float wave1 = sin(currentAngle * p1);
        float wave2 = sin(currentAngle * p2);
        float wave = mix(wave1, wave2, smoothstep(0.0, 1.0, blend));

        wave += sin(currentAngle * 3.0 - time * 2.0) * 0.2;

        float ringRadius = 0.5 + 0.1 * wave;
        float screenRadius = ringRadius * projection * 0.4;

        // --- Visuals ---
        float dist = abs(radius - screenRadius);
        float thickness = 0.008 * projection; 

        float lineGlow = exp(-dist / thickness) * 1.5;
        float fog = smoothstep(0.0, 0.7, projection); 

        // --- COLOR CALCULATION ---
        // Hue = Base(Animated) + Depth * Spread
        // This creates a linear gradient that never jumps
        float layerHue = animHue + z * spread * 0.5;

        vec3 col = getRichPastelColor(layerHue, clamp(z * 0.1, 0.0, 1.0));

        // Composition
        finalColor += col * lineGlow * fog;

        // Fill
        float fill = smoothstep(thickness * 4.0, 0.0, dist);
        finalColor += col * fill * 0.03 * fog * projection;
    }

    // Center Glow
    // Use the hue at deep depth (z=2.0 approx)
    float farHue = animHue + 2.0 * spread * 0.5;
    vec3 farCol = hsb2rgb(vec3(fract(farHue), 0.6, 1.0));
    float centerGlow = exp(-radius * 5.0);
    finalColor += farCol * centerGlow * 0.6;

    // Post-Processing
    finalColor *= 1.2 - length(uv0) * 0.5; 
    finalColor = pow(finalColor, vec3(0.9)); 
    finalColor = clamp(finalColor, 0.0, 1.0);

    fragColor = vec4(finalColor, 1.0);
}

